import React from 'react';

const newsList = (props) => {
    console.log(props);

    const items = props.news.map((item)=>{
        return(
            <div key={item.key}>
                <h3>{item.title}</h3>
                <div>{item.feed}</div>
            </div>
        )
    })
    return(
        <div>{items}</div>
    )
}

export default newsList;
